            "comments": "Source: Mexico,MX – Presidencia de la Républica || Offense: Sentenced to 16 years and four days of prison for organized crime. || Category: Adverse Media | Subcategory: Extort-Rack-Threats || Category: Adverse Media | Subcategory: Kidnapping || Category: Enforcement | Subcategory: Drug Trafficking || Category: Enforcement | Subcategory: Organized Crime || Associations: | Affiliated Organization (Sanction List:N/A): Los Zetas, 1869886 | Co-Defendant (Enforcement:Drug Trafficking): Loredo Torres, Mario, 9299050 || Last updated: 2018-08-13 || Profile Notes: According to eldiariodecoahuila.com.mx; August 13, 2018: Mario Loredo Torres and Édgar Francisco Calzoncit Martínez, identified as member of Los Zetas, were sentenced for organzied crime, in the form of crime against health, possession of firearms of exclusive use of the army and possession of firearms without license. Loredo Torres was senteced to 26 years and one day to prison and he must pay 600 days fine. On the other hand, Calzoncit Martínez was sentenced to 16 years and four days of prison and he must pay 351 days fine. According to the investigations, those involved were arrested on March 28, 2011 at Charcas, San Luis Potosí State, when they had an armed confrontation with the authorities, in which they were injured. During their arrest, guns, cartridges, drugs and vehicles with theft report were seized.\n\nAccording to the Presidencia de la República; April 6, 2011: It was granted 40 days of custody against Moisés Loredo Torres and Edgar Francisco Calzoncit Martínez, who are being investigated for organized crime and crimes against health. Those involved, who has links to Los Zetas, were arrested on March 28, 2011 during an armed confrontation with the police.\n\nAccording to lapoliciaca.com; March 29, 2011: Moisés Loredo Torres (26) and Edgar Calzoncit Martínez (28) were arrested during an armed confrontation during a confrontation when a police operation was carried out. According to the authorities, those involved, who were members of Los Zetas, were engaged in kidnappings, extortions, drug selling control, co-opting of police authorities, among others\n\n\nDe acuerdo con eldiariodecoahuila.com.mx; Agosto 13, 2018: Mario Loredo Torres y Édgar Francisco Calzoncit Martínez, identificados como integrantes de Los Zetas, fueron sentenciados por delincuencia organizada en la modalidad de delitos contra la salud, portación de armas de uso exclusivo del ejército y portación de armas sin licencia. Loredo Torres fue sentenciado a 26 años y un día de prisión y deberá pagar 600 días de multa. Por otro lado, Calzoncit Martínez fue entenciado a 16 años y cuatro días de prisión y deberá pagar 351 días de multa. Según las investigaciones, los involucrados fueron arrestados en Marzo 28, 2011 en Charcas, San Luis Potosí, cuando tuvieron un enfrentamiento armado con las autoridades, en el cual resultaron heridos. Durante su arresto, se aseguraron armas de fuego, cartuchos, droga y vehículos con reporte de robo. \n\nDe acuerdo con la Presidencia de la República; Abril 6, 2011: Se obtuvo un arraigo 40 días contra Moisés Loredo Torres y Edgar Francisco Calzoncit Martínez, quienes son investigados por delincuencia organizada y contra la salud. Los involucrados, quienes son vinculados con Los Zetas, fueron arrestados en Marzo 28, 2011 durante un enfrentamiento armado con la policía. \n\nDe acuerdo con lapoliciaca.com; Marzo 29, 2011: Moisés Loredo Torres (26) y Edgar Calzoncit Martínez (28) fueron arrestados durante un enfrentamiento cuando se realizaba un operativo policial. Según las autoridades, los involucrados, quienes formaban parte de Los Zetas,se dedicaban a realizar secuestros, extorsiones, control sobre la venta de droga, cooptaciones de autoridades policiales, entre otros. ."
