            "comments": "Source: Colombia,CO-Fiscalía General de la Nación, República de Colombia || Offense: Prosecuted for conspiracy to commit murder, aggravated murder, and torture. || Category: Enforcement | Subcategory: Conspiracy || Category: Enforcement | Subcategory: Drug Trafficking || Category: Enforcement | Subcategory: Extort-Rack-Threats || Category: Enforcement | Subcategory: Human Rights Abuse || Category: Enforcement | Subcategory: Murder || Category: Enforcement | Subcategory: Organized Crime || Associations: | Associate (Enforcement:Organized Crime): Castillo Serna, Hector Fabio, 5252253 | Associate (Enforcement:Murder): Molina Aguilar, Anderson, 7541125 | Associate (Enforcement:Arms Trafficking): Rengifo Peñaloza, Daniel Darío, 7541129 | Co-Defendant (Enforcement:Organized Crime): Alvarez Restrepo, Jorge Andres, 5252250 | Co-Defendant (Enforcement:Organized Crime): Aragón Solís, Dilber Andrés, 5252260 | Co-Defendant (Enforcement:Organized Crime): Beltrán, Freddy Ermerson, 5252249 | Co-Defendant (Enforcement:Organized Crime): Giraldo Valdez, Luz Dania, 5252276 | Co-Defendant (Enforcement:Conspiracy): Gómez Villada, Jefferson, 3745343 | Co-Defendant (Enforcement:Conspiracy): González Lasprilla, Ricardo, 7540927 | Co-Defendant (Enforcement:Organized Crime): Lozano Valencia, Julieta, 5252283 | Co-Defendant (Enforcement:Organized Crime): Montoya Guapacha, Estella, 5252231 | Co-Defendant (Enforcement:Organized Crime): Ocampo Arias, Sandra Milena, 5252274 | Co-Defendant (Enforcement:Organized Crime): Rodríguez Vidal, Cristian Mauricio, 5252256 | Co-Defendant (Enforcement:Organized Crime): Sanabria Avila, Michael Hernando, 5252259 | Co-Defendant (Enforcement:Organized Crime): Taborda Rudas, Nelson Mauricio, 5252227 | Co-Defendant (Enforcement:Organized Crime): Villanueva Lopez, Sandra Patricia, 5252278 | Co-Defendant (Enforcement:Organized Crime): Zuluaga Cañón, William Octavio, 5252236 | Co-Defendant (Enforcement:Organized Crime): Zuluaga Salazar, William Octavio, 5252237 || Last updated: 2021-06-03 || Profile Notes: According to Fiscalía General de la Nación de Colombia; September 07, 2016: Since September 05, 2016, The 7th Prosecutor's Office of Cali carries out the hearings against Nelson Mauricio Taborda Rudas and 14 other people, as alleged perpetrators of the crimes of conspiracy and aggravated murder in three events. The alleged leader of the criminal group know as 'Picante' or 'La Picantiña' is accused of perpetrator of the murder of Marlon Irley Pérez Flores and as determiner of two other murders. Taborda Rudas and the other 15 people were also accused as alleged perpetrators of crimes of torture and manufacturing, trafficking, possession of weapons, accessories, parts or ammunitions. According to research, Taborda was head of a criminal organization dedicated to drug trafficking, murder, theft and extortion that offends in the council of Tuluá (Valle del Cauca). Besides Taborda, The Prosecutors Office also accused: Ricardo González Lasprilla, Willian Octavio Zuluaga Cañón, Fredy Emerson Beltrán, Dilber Andrés Aragón Solís, Willian Octavio Zuluaga Salazar, Héctor Fabio Castillo Serna, Cristhian Mauricio Rodríguez Vidal, Julián Andrés Giraldo Duque, Sandra Milena Ocampo Arias, Estela Montoya Guapache, Luz Dania Giraldo, Julieta Lozano Valencia, Sandra Patricia Villanueva López, Dilber Andrés Aragón Solís and Michael Hernando Sanabria Ávila. These people are accused of planning and executing the murder of the soldier Bayron Tamayo Castro in November 2012 in Tuluá.  Moreover, the Prosecutors Office accused Anderson Molina Aguilar, Fredy Emerson Beltrán, Willian Octavio Zuluaga Cañón, Héctor Fabio Castillo Serna and Daniel Darío Rengifo Peñaloza, of being alleged responsibles for the murder of the agent of the Antinarcotics Police, Mauricio Ávila Espejo.\n\nAccording to Fiscalía General de la Nación of Colombia; September 23, 2013: Julián Andrés Giraldo Duque, alleged member of a criminal organization, was charged with the crimes of conspiracy, aggravated murder, extortion, trafficking, manufacturing or possession of drugs and trafficking, manufacturing or possession or firearms. On September 18, 2013, Julián Andrés Giraldo Duque, along with other individuals, was arrested as a result of 14 operations carried out simultaneously in regions of Valle del Cauca by members of the Judicial Police. According to the investigations, Julián Andrés Giraldo Duque, allegedly participated in committing more than 20 murders, between November 2012 and August 2013.\n\n\nDe acuerdo con Fiscalía General de la Nación de Colombia; Septiembre 07, 2016: Desde Septiembre 05, 2016, la Fiscalía 7ª Especializada de Cali adelanta el juicio oral en contra de Nelson Mauricio Taborda Rudas y de 14 personas más, como presuntos autores de los delitos de concierto para delinquir con fines de homicidio, homicidio agravado en concurso homogéneo y sucesivo en tres eventos. El supuesto jefe de la banda denominada 'Picante o La Picantiña', es señalado como autor material del asesinato de Marlon Irley Pérez Flores y como autor determinador de dos homicidios más. Taborda Rudas y los otros 15 sujetos también fueron acusados, como autores materiales de los delitos de tortura y fabricación, tráfico, porte o tenencia de armas de fuego, accesorios, partes o municiones. De acuerdo con la investigación, Taborda dirigía una organización criminal, al servicio del narcotráfico, que tiene como sede de operaciones el municipio de Tuluá (Valle del Cauca) dedicada a la comisión de homicidios, en modalidad de sicariato; al tráfico de estupefacientes, al hurto y la extorsión. Además de Taborda, la Fiscalía también acusó a Ricardo González Lasprilla, Willian Octavio Zuluaga Cañón, Fredy Emerson Beltrán, Dilber Andrés Aragón Solís, Willian Octavio Zuluaga Salazar, Héctor Fabio Castillo Serna, Cristhian Mauricio Rodríguez Vidal, Julián Andrés Giraldo Duque, Sandra Milena Ocampo Arias, Estela Montoya Guapache, Luz Dania Giraldo, Julieta Lozano Valencia, Sandra Patricia Villanueva López, Dilber Andrés Aragón Solís y Michael Hernando Sanabria Ávila. Estas personas son acusadas de planear y ejecutar el asesinato en Noviembre 2012 en Tuluá del soldado Bayron Tamayo Castro. Además señala como posibles responsables del homicidio del agente de la Policía Antinarcóticos, Mauricio Ávila Espejo, a: Anderson Molina Aguilar, Fredy Emerson Beltrán, Willian Octavio Zuluaga Cañón, Héctor Fabio Castillo Serna y Daniel Darío Rengifo Peñaloza.\n\nDe acuerdo con la Fiscalía General de la Nación de Colombia; Septiembre 23, 2013: Julián Andrés Giraldo Duque, presunta miembro de una organización criminal, fue cobijado con medida de aseguramiento por los delitos de concierto para delinquir, homicidio agravado, extorsión, tráfico, fabricación y porte de drogas y tráfico, fabricación y porte de armas de fuego. En Setiembre 18, 2013, Julián Andrés Giraldo Duque, junto con otros individuos, fue arrestado como resultado de 14 operaciones ejecutadas simultáneamente en zonas de Valle del Cauca por miembros de la policía Judicial. según las investigaciones, Julián Andrés Giraldo Duque, presuntamente participó en la comisión de más de 20 homicidios, entre Noviembre 2012 y Agosto 2013."
